-- Name: get_warehouse_inventory_details(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_warehouse_inventory_details(p_warehouse_inventory_uuid uuid) RETURNS TABLE(uuid uuid, company_uuid uuid, admin_uuid uuid, warehouse_uuid uuid, inventory_uuid uuid, name text, description text, measurement_unit text, standard_unit text, unit_values jsonb, count jsonb, properties jsonb, status text, warehouse_info jsonb, inventory_info jsonb, delivery_info jsonb, items jsonb, created_at timestamp with time zone, updated_at timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
BEGIN
  RETURN QUERY
  SELECT 
    wi.uuid,
    wi.company_uuid,
    wi.admin_uuid,
    wi.warehouse_uuid,
    wi.inventory_uuid,
    wi.name,
    wi.description,
    wi.measurement_unit,
    wi.standard_unit,
    wi.unit_values,
    wi.count,
    wi.properties,
    wi.status,
    jsonb_build_object(
      'uuid', w.uuid,
      'name', w.name,
      'address', w.address
    ) as warehouse_info,
    jsonb_build_object(
      'uuid', inv.uuid,
      'name', inv.name,
      'description', inv.description
    ) as inventory_info,
    COALESCE(
      jsonb_agg(
        DISTINCT jsonb_build_object(
          'uuid', di.uuid,
          'name', di.name,
          'delivery_date', di.delivery_date,
          'status', di.status,
          'delivery_address', di.delivery_address
        )
      ) FILTER (WHERE di.uuid IS NOT NULL),
      '[]'::jsonb
    ) as delivery_info,
    COALESCE(
      jsonb_agg(
        DISTINCT jsonb_build_object(
          'uuid', wii.uuid,
          'item_code', wii.item_code,
          'unit', wii.unit,
          'unit_value', wii.unit_value,
          'packaging_unit', wii.packaging_unit,
          'cost', wii.cost,
          'location', wii.location,
          'group_id', wii.group_id,
          'status', wii.status,
          'created_at', wii.created_at
        )
      ) FILTER (WHERE wii.uuid IS NOT NULL),
      '[]'::jsonb
    ) AS items,
    wi.created_at,
    wi.updated_at
  FROM warehouse_inventory wi
  LEFT JOIN warehouses w ON wi.warehouse_uuid = w.uuid
  LEFT JOIN inventory inv ON wi.inventory_uuid = inv.uuid
  LEFT JOIN warehouse_inventory_items wii ON wi.warehouse_uuid = wii.warehouse_uuid 
    AND wi.inventory_uuid = wii.inventory_uuid
  LEFT JOIN delivery_items di ON wii.delivery_uuid = di.uuid
  WHERE wi.uuid = p_warehouse_inventory_uuid
  GROUP BY 
    wi.uuid, wi.company_uuid, wi.admin_uuid, wi.warehouse_uuid, wi.inventory_uuid,
    wi.name, wi.description, wi.measurement_unit, wi.standard_unit,
    wi.unit_values, wi.count, wi.properties, wi.status, wi.created_at, wi.updated_at,
    w.uuid, w.name, w.address, inv.uuid, inv.name, inv.description;
END;
$$;


