--
-- Name: get_warehouse_inventory_filtered(uuid, text, uuid, text, integer, integer, integer, integer, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_warehouse_inventory_filtered(p_company_uuid uuid DEFAULT NULL::uuid, p_search text DEFAULT ''::text, p_warehouse_uuid uuid DEFAULT NULL::uuid, p_status text DEFAULT NULL::text, p_year integer DEFAULT NULL::integer, p_month integer DEFAULT NULL::integer, p_week integer DEFAULT NULL::integer, p_day integer DEFAULT NULL::integer, p_limit integer DEFAULT 100, p_offset integer DEFAULT 0) RETURNS TABLE(uuid uuid, company_uuid uuid, admin_uuid uuid, warehouse_uuid uuid, inventory_uuid uuid, name text, description text, measurement_unit text, standard_unit text, unit_values jsonb, count jsonb, status text, warehouse_name text, inventory_name text, items_count integer, created_at timestamp with time zone, updated_at timestamp with time zone, total_count bigint)
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_search_pattern TEXT;
  total_rows BIGINT;
BEGIN
  v_search_pattern := '%' || COALESCE(p_search, '') || '%';
  
  -- Get total count
  SELECT COUNT(*) INTO total_rows
  FROM warehouse_inventory wi
  LEFT JOIN warehouses w ON wi.warehouse_uuid = w.uuid
  LEFT JOIN inventory inv ON wi.inventory_uuid = inv.uuid
  WHERE 
    (p_company_uuid IS NULL OR wi.company_uuid = p_company_uuid)
    AND (p_warehouse_uuid IS NULL OR wi.warehouse_uuid = p_warehouse_uuid)
    AND (p_status IS NULL OR wi.status = p_status)
    AND (p_year IS NULL OR EXTRACT(YEAR FROM wi.created_at) = p_year)
    AND (p_month IS NULL OR EXTRACT(MONTH FROM wi.created_at) = p_month)
    AND (p_week IS NULL OR EXTRACT(WEEK FROM wi.created_at) = p_week)
    AND (p_day IS NULL OR EXTRACT(DAY FROM wi.created_at) = p_day)
    AND (
      p_search = '' OR p_search IS NULL
      OR wi.uuid::TEXT ILIKE v_search_pattern
      OR wi.name ILIKE v_search_pattern
      OR COALESCE(wi.description, '') ILIKE v_search_pattern
      OR w.name ILIKE v_search_pattern
      OR inv.name ILIKE v_search_pattern
    );

  RETURN QUERY
  SELECT 
    wi.uuid,
    wi.company_uuid,
    wi.admin_uuid,
    wi.warehouse_uuid,
    wi.inventory_uuid,
    wi.name,
    wi.description,
    wi.measurement_unit,
    wi.standard_unit,
    wi.unit_values,
    wi.count,
    wi.status,
    w.name as warehouse_name,
    inv.name as inventory_name,
    (wi.count->>'total')::INT AS items_count,
    wi.created_at,
    wi.updated_at,
    total_rows
  FROM warehouse_inventory wi
  LEFT JOIN warehouses w ON wi.warehouse_uuid = w.uuid
  LEFT JOIN inventory inv ON wi.inventory_uuid = inv.uuid
  WHERE 
    (p_company_uuid IS NULL OR wi.company_uuid = p_company_uuid)
    AND (p_warehouse_uuid IS NULL OR wi.warehouse_uuid = p_warehouse_uuid)
    AND (p_status IS NULL OR wi.status = p_status)
    AND (p_year IS NULL OR EXTRACT(YEAR FROM wi.created_at) = p_year)
    AND (p_month IS NULL OR EXTRACT(MONTH FROM wi.created_at) = p_month)
    AND (p_week IS NULL OR EXTRACT(WEEK FROM wi.created_at) = p_week)
    AND (p_day IS NULL OR EXTRACT(DAY FROM wi.created_at) = p_day)
    AND (
      p_search = '' OR p_search IS NULL
      OR wi.uuid::TEXT ILIKE v_search_pattern
      OR wi.name ILIKE v_search_pattern
      OR COALESCE(wi.description, '') ILIKE v_search_pattern
      OR w.name ILIKE v_search_pattern
      OR inv.name ILIKE v_search_pattern
    )
  ORDER BY wi.created_at DESC
  LIMIT p_limit OFFSET p_offset;
END;
$$;


ALTER FUNCTION public.get_warehouse_inventory_filtered(p_company_uuid uuid, p_search text, p_warehouse_uuid uuid, p_status text, p_year integer, p_month integer, p_week integer, p_day integer, p_limit integer, p_offset integer) OWNER TO postgres;

