--
-- Name: recalculate_all_inventory_aggregations(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.recalculate_all_inventory_aggregations() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    inventory_record RECORD;
    updated_count INTEGER := 0;
BEGIN
    -- Loop through all inventories and recalculate their aggregations
    FOR inventory_record IN 
        SELECT uuid FROM inventory 
    LOOP
        PERFORM update_single_inventory_aggregation(inventory_record.uuid);
        updated_count := updated_count + 1;
    END LOOP;
    
    RETURN updated_count;
END;
$$;


